import React, { Component } from "react";
import "./App.css";

class About extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="About">
        <div className="titles">
          <h1> selected works </h1>
          <Title text="branding." />
          <Title text="collages." />
          <Title text="keynote designs." />
          <Title text="posters." />
          <Title text="user interface designs." />
        </div>
        <div className="menu">
          <h1>about</h1>
          <h1>linkedin</h1>
          <h1>résumé</h1>
          <h1>contact</h1>
        </div>
        <div className="imageWrapper">
          <img src="https://raw.githubusercontent.com/tirzatirza14/portfolio/master/spread.gif" />
        </div>
      </div>
    );
  }
}

export default About;
